import React from "react";
import { Stack } from "@mui/material";
import { Link } from "react-router-dom";

import { logo } from "../utils/constants";

const Navbar = () => {
  <Stack>
    <img src={logo} aLt="logo" height={45} />
  </Stack>;
};

export default Navbar;
